import React from 'react'
import { AuthConsumer } from "../authContext";
import Can from "../components/Can"
import AdminMenu from "../components/AdminMenu"

const Driver = () => (
    <AuthConsumer>
    {({ user }) => (
        <div>
            <h1>driver page</h1>
            <Can
                role={user.role}
                perform="admin:visit"
                yes={() => (
                <div>
                    <AdminMenu />
                </div>
                )}
                
            />
            
        </div>
      
    )}
  </AuthConsumer>
)

export default Driver
